import React from 'react';
function Home(){
    return (
        <div className='row'>
            <div className='col-md-12 be_courageous'>
                <h1>Be Courageous</h1>
                <p>Be strong and courageous, do not be terrified, do not be discouraged, for the Lord your God is with you where ever you go.</p>
            </div>
        </div>
    )
}
export default Home;
